import React from 'react';
import {usersFetchData} from "../src/actions/users.js";
import {connect} from "react-redux";

class UsersListTable extends React.Component {

    render() {
        return <div>
            {this.props.users.map((user, index) => {
                return <div key={index} className="list-group-item">
                    <table className="table table-hover">
                        <thead>
                            <tr>
                                <th scope="col">#</th>
                                <th scope="col">Имя</th>
                                <th scope="col">Возраст</th>
                                <th scope="col">Страна</th>
                            </tr>
                        </thead>
                        <tbody>
                        <tr>
                            {/*<th scope="row">1</th>*/}
                            <td>{user.name}</td>
                            <td>{user.age}</td>
                            <td>{user.country}</td>
                        </tr>
                        </tbody>
                    </table>
                </div>
            })
            }
            }
        </div>

        /*render(<UsersListTable />);*/
    }
}

const mapStateToProps = (state) => {
    return {
        users: state.users
    };
};

const mapDispatchToProps = dispatch => {
    return {
        fetchData: url => dispatch(usersFetchData(url))
    };
};

export default connect(mapStateToProps, mapDispatchToProps)(UsersListTable);
// export default UsersListTable;
